    width: 115px;
    height: 25px;
    border-radius: 10px;
    background-color: ${colors.primary};
    color: #fff;
    font-size: 14px;
    font-weight: 500;
    text-align: center;
`

class Tags extends Component {
    constructor(props) {
    super(props)
    this.state = {}
}

    render(){
        const tags = this.props.tags
        console.log(tags)

        return(<ul>
            {tags && tags.map(tag => <TagsLi key={`tag-${tag.id}`}>{tag}</TagsLi>)}
        </ul>
        )
    }
}

export default Tags
